import car from "./car.jpg";

function CarInfo({ carDetails }) {
  return carDetails ? (
    <div>
      <h1 class="font-mono text-center">About this car...</h1>
      <p class="font-mono text-center font-medium">
        Registration: {carDetails.registration}
      </p>
      <p class="font-mono text-center font-medium">Make: {carDetails.make}</p>
      <p class="font-mono text-center font-medium">Model: {carDetails.model}</p>
      <p class="font-mono text-center font-medium ">
        Colour: {carDetails.primaryColour}
      </p>
      <p class="font-mono text-center font-medium text-emerald-800">
        MOT expires on: {carDetails.motTests[0].expiryDate}
      </p>
      <p class="font-mono text-center font-medium">
        Last recorded mileage: {carDetails.motTests[0].odometerValue}
      </p>
    </div>
  ) : (
    <div>
      <p class="font-mono text-center">
        Please insert a valid registration number.
      </p>
      <img
        src={car}
        alt="car"
        class="h-24 md:h-64 w-full object-cover rounded-xl flex flex-col justify-center items-center"
      />
    </div>
  );
}

export default CarInfo;
